import React, { useEffect, useState } from 'react';
import api from '../api/axios';
import { useAuth } from '../context/AuthContext';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { Download, PlusCircle } from 'lucide-react';

const AdminPanel = () => {
  const [students, setStudents] = useState([]);
  const [analytics, setAnalytics] = useState([]);
  const [loading, setLoading] = useState(true);
  const { logout } = useAuth();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [studentsRes, analyticsRes] = await Promise.all([
          api.get('/admin/students'),
          api.get('/admin/analytics')
        ]);
        setStudents(studentsRes.data);
        setAnalytics(analyticsRes.data.analytics);
        setLoading(false);
      } catch (err) {
        console.error(err);
      }
    };
    fetchData();
  }, []);

  const exportCSV = () => {
    const headers = ['Name', 'Email', 'Total Quizzes', 'Avg Score', 'Last Attempt'];
    const rows = students.map(s => [s.name, s.email, s.totalQuizzes, `${s.avgScore}%`, s.lastAttempt ? new Date(s.lastAttempt).toLocaleDateString() : 'N/A']);
    
    let csvContent = "data:text/csv;charset=utf-8," + headers.join(",") + "\n" + rows.map(e => e.join(",")).join("\n");
    const encodedUri = encodeURI(csvContent);
    const link = document.createElement("a");
    link.setAttribute("href", encodedUri);
    link.setAttribute("download", "student_stats.csv");
    document.body.appendChild(link);
    link.click();
  };

  if (loading) return <div className="p-8 text-center">Loading Admin Data...</div>;

  return (
    <div className="p-8 max-w-7xl mx-auto">
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-3xl font-bold">Admin Dashboard</h1>
        <div className="space-x-4">
          <button onClick={exportCSV} className="bg-green-600 text-white px-4 py-2 rounded flex items-center gap-2 inline-flex">
            <Download size={18} /> Export CSV
          </button>
          <button onClick={logout} className="bg-red-500 text-white px-4 py-2 rounded">Logout</button>
        </div>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 mb-12">
        <div className="bg-white p-6 rounded shadow">
          <h3 className="text-xl font-bold mb-4">Average Scores by Exam</h3>
          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <BarChart data={analytics}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="exam" />
                <YAxis domain={[0, 100]} />
                <Tooltip />
                <Bar dataKey="avgScore" fill="#3b82f6" />
              </BarChart>
            </ResponsiveContainer>
          </div>
        </div>
        <div className="bg-white p-6 rounded shadow">
          <h3 className="text-xl font-bold mb-4">Popular Exams (Total Attempts)</h3>
          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <BarChart data={analytics}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="exam" />
                <YAxis />
                <Tooltip />
                <Bar dataKey="totalAttempts" fill="#8b5cf6" />
              </BarChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>

      <div className="bg-white rounded shadow overflow-hidden">
        <div className="p-6 border-b flex justify-between items-center">
          <h3 className="text-xl font-bold">Student Progress</h3>
        </div>
        <table className="w-full text-left">
          <thead className="bg-gray-50 text-gray-600 uppercase text-sm">
            <tr>
              <th className="p-4">Student</th>
              <th className="p-4">Email</th>
              <th className="p-4 text-center">Quizzes</th>
              <th className="p-4 text-center">Avg Score</th>
              <th className="p-4">Last Attempt</th>
            </tr>
          </thead>
          <tbody className="divide-y">
            {students.map((student, i) => (
              <tr key={i} className="hover:bg-gray-50">
                <td className="p-4 font-medium">{student.name}</td>
                <td className="p-4 text-gray-600">{student.email}</td>
                <td className="p-4 text-center">{student.totalQuizzes}</td>
                <td className="p-4 text-center">
                  <span className={`px-2 py-1 rounded text-sm ${student.avgScore >= 70 ? 'bg-green-100 text-green-800' : student.avgScore >= 40 ? 'bg-yellow-100 text-yellow-800' : 'bg-red-100 text-red-800'}`}>
                    {student.avgScore}%
                  </span>
                </td>
                <td className="p-4 text-gray-500">
                  {student.lastAttempt ? new Date(student.lastAttempt).toLocaleDateString() : 'Never'}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminPanel;
